import React, { Component } from 'react';

class test extends Component {
    constructor(){
        super();
        this.state = {
            count : 10
        }
        this.handleClick = () =>{
            this.setState({count: this.state.count + 1})
        }
    }
    render() {
        return (
            <div>
                <button onClick={this.handleClick} >Click me</button>
                <div>{this.state.count}</div>
            </div>
        );
    }
}

export default test;
